      <text id="102" justification="0" size="4" underlined="false">
        <text>Usage of this api would be as follows;
Create a class &lt;b&gt;YourTrial&lt;/b&gt; 
&lt;/b&gt;
NOTES: 
The &lt;b&gt;YourTrial&lt;/b&gt; names will never be plural.
The &lt;b&gt;YourTrial&lt;/b&gt; would extend one of;
&lt;b&gt;FunctionalTrial, PackageTrial or ClassTrial&lt;/b&gt;
&lt;/b&gt;
The &lt;b&gt;YourTrial&lt;/b&gt; class must then have;
1) a respective &lt;b&gt;TestScope&lt;/b&gt; annotation
2) A no argument constructor.
3) at least one method with the &lt;b&gt;@Test&lt;/b&gt; Annotation
ie;
&lt;b&gt;@Test&lt;/b&gt;
public void testOrderFoodSuccess() {}
&lt;/b&gt;
The &lt;b&gt;YourTrial&lt;/b&gt; class may have;
1) A single static method with a &lt;b&gt;@BeforeTrial&lt;/b&gt; Annotation
which will run before the class is constructed.
2) A optional override of the &lt;b&gt;beforeTests()&lt;/b&gt; method.
3) Additinal methods with &lt;b&gt;@Test&lt;/b&gt; Annotations.
4) A optinal override of the &lt;b&gt;afterTests()&lt;/b&gt; method.
5) A single static method with a &lt;b&gt;@AfterTrial&lt;/b&gt; Annotation

</text>
      </text>
